THE ALEX JONES SHOW
February 12, 2009

*Forgot .M3U play list - if that matters check TJ7.

HR 1: Intro, Cynthia Davis
HR 2: News &amp; commentary, Mark Dice
HR 3: Mark Dice &amp; calls
HR 4: Mark Dice, Russell Means

Alex talks with Missouri Rep. Cynthia Davis about the Tenth Amendment and states-rights, San Diego political activist and author of The Resistance Manifesto, Mark Dice, and prolific activist for the rights of American Indians, Russell Means. 


